2		Zafarraya - Los Barracones del Robledal	Ruta que discurre por parte de la que una vez fue la Ruta de los Pescaeros de Loja, y que desde Torre del Mar llevaban el pescado pasando por la Axarquía y el Llano de Zafarraya para atravesando Sierra Gorda, llegar hasta Loja	<a href="http://es.wikiloc.com/wikiloc/view.do?id=4473968">Acceso a Wikiloc para ver y descargar ruta</a>	Bicicleta de montaña
3		Zafarraya - Los Barracones del Robledal	La ruta tiene dos partes, una hasta la Alcaiceria, que es todo en asfalto en un estado magnífico, y sobre el que se rueda como una moto, y desde ahí en pista forestal en muy buen estado, siendo cada parte más o menos de un 50% del recorrido	<a href="http://es.wikiloc.com/wikiloc/view.do?id=4691308">Acceso a Wikiloc para ver y descargar ruta</a>	Bicicleta de montaña
\.


